float RgfN2::zh(float bar, float celsius) {
    int last = 0;
    int index_bar1 = 0;
    int index_bar2 = 0;
    int index_temp1 = 0;
    int index_temp2 = 0;
    for (int i = 0; i < rgf_n2_p.size(); ++i) {
        int current = rgf_n2_p[i];

        if (bar >= (float) last && bar <= (float) current) {
            index_bar1 = i - 1;
            index_bar2 = i;
            break;
        }
        last = current;
    }

    if (index_bar1 < 0 ) {
        index_bar1 = 0;
    }

    last = 0;
    for (int i = 0; i < rgf_n2_t.size(); ++i) {
        int current = rgf_n2_t[i];

        if (celsius >= (float) last && celsius <= (float) current) {
            index_temp1 = i - 1;
            index_temp2 = i;

            break;
        }

        last = current;
    }

    utils::geom::Point3D A = { (float) rgf_n2_p[index_bar1], (float) rgf_n2_t[index_temp1], rgf_n2[index_bar1][index_temp1]};
    utils::geom::Point3D B = { (float) rgf_n2_p[index_bar2], (float) rgf_n2_t[index_temp1], rgf_n2[index_bar2][index_temp1]};
    utils::geom::Point3D C = { (float) rgf_n2_p[index_bar2], (float) rgf_n2_t[index_temp2], rgf_n2[index_bar2][index_temp2]};
    utils::geom::Point3D D = { (float) rgf_n2_p[index_bar1], (float) rgf_n2_t[index_temp2], rgf_n2[index_bar1][index_temp2]};

    utils::geom::Point3D X = {bar, celsius, 0};

    X.z = interpolateZ(A, B, C, D, X);

    return X.z;
}
